import "./App.css";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import TextFields from "./components/Log";
import Register from "./components/Reg";
import Home from "./components/Home";
import AdminLog from "./components/AdminLogin";
import AdminP from "./components/Admin";
import UserProtectedRoute from "./components/UserProtectedRoute";
import AdminProtectedRoute from "./components/AdminProtectedRoute";
import { AuthProvider } from "./AuthContext";

export default function App() {
  return (
    <AuthProvider>
      <Router>
        <Routes>
          <Route path="/register" element={<Register />} />
          <Route path="/login" element={<TextFields />} />
          <Route path="/home" element={<Home />} />
          <Route path="/adminLogin" element={<AdminLog />} />
          <Route
            path="/adminPage"
            element={<AdminProtectedRoute element={AdminP} />}
          />
        </Routes>
      </Router>
    </AuthProvider>
  );
}
